import {StyleSheet} from 'react-native'

export const WindowsModal = StyleSheet.create({
    Main: {
        marginTop:'10vh',
        marginLeft:'10vw',
        position:'absolute',
        backgroundColor:'pink',
        opacity:1,
        width:'80vw',
        height:'80vh'
    },
    Background: {
        height:'100vh',
        width:'100vw',
        backgroundColor:'black',
        opacity:0.1
    },
    BigMain:{
        position:'absolute',
        zIndex:1000,
        display:'flex'
    }
});
export const BoxAuthentification = StyleSheet.create({
    background : {
        zIndex:1
    },
    BigMain : {
        position:'absolute',
        zIndex:1000,
        display:'flex'
    }
})
